import { useState, useEffect } from "react";
import { Card, Button } from "react-bootstrap";
import axios from "axios";

export default function PtofilePage() {
  const [userData, setUserData] = useState([]);

  useEffect(() => {
    getdata();
  }, []);

  const getdata = () => {
    let url = "http://localhost:4000/profile";
    const token = localStorage.getItem("x-access-token");

    axios.get(url, { headers: { "x-access-token": token } }).then((res) => {
      setUserData(res.data.message);
      console.log(res.data);
    });
  };

  return (
    <>
      <div className="container" style={{ display: "grid" }}>
        <div className="row">
          <Card style={{ width: "30rem", height: "15rem", margin: "10rem" }}>
            <Card.Body>
              <Card.Title className="mb-4">User Datails</Card.Title>
              <Card.Text>Name : {userData.name} </Card.Text>
              <Card.Text>Number : {userData.number} </Card.Text>
              <Card.Text>Email : {userData.email} </Card.Text>
              <Button
                variant="primary"
                className="mx-2"
                onClick={function () {
                  console.log(userData._id);
                }}
              >
                Edit
              </Button>
              <Button variant="primary">Delet</Button>
            </Card.Body>
          </Card>
          <div className="col-md-7">
            <Card style={{ width: "30rem", height: "15rem", margin: "10rem" }}>
              <Card.Body>
                <Card.Title className="mb-4"> Edit Your data</Card.Title>
                <Card.Text>Name : {userData.name} </Card.Text>
                <Card.Text>Number : {userData.number} </Card.Text>
                <Card.Text>Email : {userData.email} </Card.Text>
                <Button
                  variant="primary"
                  className="mx-2"
                  onClick={function () {
                    console.log(userData._id);
                  }}
                >
                  Update
                </Button>
                <Button variant="primary">Delet</Button>
              </Card.Body>
            </Card>
          </div>
        </div>
      </div>
    </>
  );
}
